  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains information about
  the American White Pelican population for the Anaho Island National Wildlife Refuge
  in the Stillwater National Wildlife Refuge Complex. Documents within in the collection
  include hand-written notes, offices memorandums, bird counts, and typed reports.
  Species covered in the research are American White Pelican, Double-crested Cormorant,
  Canada Goose, California Gull, Caspian Tern, Great Blue Heron, and miscellaneous
  other birds. At the beginning of the collection a typed report summarizes each year's
  observations and includes species specific notes, followed by a collection of office
  memos and hand written notes and data.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
